// import React, { useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";
import { useEffect, useState } from "react";
import DisplayProjects from "../DisplayProjects/index";

// export default function Projects({ projectName }) {

export default function Projects() {
  const [data, setData] = useState([]);
  // const [projects, setProjects] = useState([]);

  const { type } = useParams();

  useEffect(() => {
    axios.get(`http://localhost:5000/projects/${type}`).then((res) => {
      // const arr = res.data.concat(projectName)
      // setData(arr);
      console.log(res);

      console.log(res.data.type);
      setData(res.data);
      console.log(data);
    });
  }, []);

  return (
    <>
    <div> </div>
      {data.map((elem) => {
        return (
          <DisplayProjects style={{display:"grid", gridTemplateColumns: "1fr 1fr 1fr"}}
            url={elem.img}
            leader={elem.leader}
            date={elem.date}
            name={elem.name}
            type={elem.type}
            desc={elem.desc}
            team={elem.teamNeeded}
            level={elem.level}
            location={elem.location}
          />
        );
      })}
    </>
  );
}
